Crash Bandicoot: Warped is a platform game in which the player controls Crash and Coco Bandicoot, who must travel back in time and gather the 25 Crystals from the previous game in their original places in time before the antagonists of the story do so. Much of the game takes place in the Time-Twisting Machine, which acts as the hub area of the game. The Time-Twisting Machine is split up into five chambers; only the first chamber is initially available. Each chamber has five buttons that open portals to different levels.[2] The goal in each level is to find and obtain the Crystal hidden in the area. In some levels, the Crystal will be located at the end of a level or must be earned by completing a specific challenge.[3] Some levels contain a &quot;Bonus Platform&quot; that leads to a special bonus area, where the player must navigate through a separate area and collect everything in sight. As no lives are lost in the bonus areas, the bonus areas can be played through as often as the player desires until the bonus area can be cleared.[4] After completing all five levels in a chamber, a sixth button that opens a portal to a boss level will appear. By defeating the boss, the next chamber will become available for play.[2] When all 25 Crystals are found and all five boss characters are defeated, the game is won.[5]
